window.bookSummaryJSON = "<p><b>A mark, a Calling, and a fate I didn't see coming.</b></p> <p>I thought surviving the Hawthorne alpha's wrath would put an end to my trials.</p> <p>I was wrong. </p> <p>I've been marked, branded by mystical forces, and with no clue what's about to happen, I'm going in blind. </p> <p>All I know is that it will be a test of survival. All I want is to find a way out.</p> <p>But as the hours tick by and the Calling gets close, I'm forced to accept that maybe fate can't always be thwarted.</p> <p><b>Sometimes the things we wish for are the very things we should be running from.</b></p>"; 
